void cbWorker(dyn_string dp, dyn_anytype val){
      // Average temp
      sdShowValue(&quot;txt1_atemp&quot;, dp[1], val[1], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu1_atemp&quot;, &quot;text&quot;, dpGetUnit(dp[1]));
      // Average density
      sdShowValue(&quot;txt1_adens&quot;, dp[2], val[2], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu1_adens&quot;, &quot;text&quot;, dpGetUnit(dp[2]));
      // current status post
      PUSH_BUTTON6.enabled = (val[3] == 0x30);
      PUSH_BUTTON6.enabled = (val[3] == 0x00);
      PUSH_BUTTON7.enabled = (val[3] != 0x20);
      PUSH_BUTTON8.enabled = (val[3] == 0x20);
      PUSH_BUTTON9.enabled = (val[3] == 0x30);
      string res;
      switch(val[3]){
        case 0x00:
          res = &quot;Ожидание&quot;;

          break;
        case 0x10:
          res = &quot;Разрешение налива&quot;;
          break;
        case 0x20:
          res = &quot;Налив&quot;;
          break;
        case 0x30:
          res = &quot;Пауза&quot;;
          break;
        case 0x40:
          res = &quot;Продолжение&quot;;
          break;
        case 0x60:
          res = &quot;Ошибка&quot;;
          break;
        case 0x80:
          res = &quot;Не активный&quot;;
          break;
        default:
          res = &quot;Неизвестно&quot;;
      }
      setValue(&quot;pst1_sts&quot;, &quot;text&quot;, res);
      // Vol dose
      sdShowValue(&quot;txt1_vol_dose&quot;, dp[4], val[4], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu1_vol_dose&quot;, &quot;text&quot;, dpGetUnit(dp[4]));
      // Vol flow
      sdShowValue(&quot;txt1_flow_v&quot;, dp[5], val[5], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu1_flow_v&quot;, &quot;text&quot;, dpGetUnit(dp[5]));
      // Total dose
      sdShowValue(&quot;txt1_mass_dose&quot;, dp[6], val[6], 1, &quot;1&quot;, 0, &quot;&quot;); //6- Массовая доза
      setValue(&quot;eu1_mass_dose&quot;, &quot;text&quot;, dpGetUnit(dp[6]));
      if(val[7] == 1){
        setValue(&quot;trap&quot;, &quot;backCol&quot;, &quot;Green&quot;);
        trap_txt.text(&quot;Рабочее положение трапа&quot;);
      }
      else
      {
        setValue(&quot;trap&quot;, &quot;backCol&quot;, &quot;Grey&quot;);
        trap_txt.text(&quot;Гаражное положение трапа&quot;);
      }
      if(val[8] == 1)
      {
        setValue(&quot;ground&quot;, &quot;backCol&quot;, &quot;Green&quot;);
        ground_txt.text(&quot;Заземлено&quot;);
      }
      else
      {
        setValue(&quot;ground&quot;, &quot;backCol&quot;, &quot;Grey&quot;);
        ground_txt.text(&quot;Не заземлено&quot;);
      }
      if(val[9] == 1)
      {
        setValue(&quot;garage_pos&quot;, &quot;backCol&quot;, &quot;Grey&quot;);
        garage_pos_txt.text(&quot;Гаражное положение стояка&quot;);
      }
      else
      {
        setValue(&quot;garage_pos&quot;, &quot;backCol&quot;, &quot;Green&quot;);
        garage_pos_txt.text(&quot;Рабочее положение стояка&quot;);
      }
      if(val[10] == 1)
      {
        naliv_s_prisadk.enabled(0);
        naliv_bez_prisadk.enabled(1);
        PercentPrisadki.enabled(1);
        FRAME1.text(&quot;Выбран налив с присадкой&quot;);
      }
      else
      {
        naliv_s_prisadk.enabled(1);
        naliv_bez_prisadk.enabled(0);
        PercentPrisadki.enabled(0);
        FRAME1.text(&quot;Выбран налив без присадки&quot;);
      }
       if(val[11] == 1){
        setValue(&quot;pst1_ovr&quot;, &quot;backCol&quot;, &quot;Red&quot;);
        pst1_ovr_txt.text(&quot;Перелив&quot;);
      }
      else
      {
        setValue(&quot;pst1_ovr&quot;, &quot;backCol&quot;, &quot;Grey&quot;);
        pst1_ovr_txt.text(&quot;Уровень в норме&quot;);
      }
      // Volume Fact
      sdShowValue(&quot;txt1_vol&quot;, dp[12], val[12], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu1_vol&quot;, &quot;text&quot;, dpGetUnit(dp[12]));
      // Mass Fact
      sdShowValue(&quot;txt1_mass&quot;, dp[13], val[13], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;eu1_mass&quot;, &quot;text&quot;, dpGetUnit(dp[13]));

      sdShowValue(&quot;VolumeDose_oper&quot;, dp[14], val[14], 1, &quot;1&quot;, 0, &quot;&quot;);
      setValue(&quot;VolumeDose_oper_eu&quot;, &quot;text&quot;, dpGetUnit(dp[14]));

      license_plate.text = &quot;Гос. номер: &quot; + val[16];
      sdShowValue(&quot;PercentPrisadki&quot;, dp[17], val[17], 1, &quot;1&quot;, 0, &quot;&quot;);



}

