main()
{

  const string DP = $dp;
  const string NumberPost = $NumberPost;
  string Adr;
  int VolumeDose_op;
  Adr = DP + &quot;.Global_Variable.bui_PercentPrisadki_&quot; + NumberPost + &quot;Post:_original.._value&quot;;
  VolumeDose_op = PercentPrisadki.text;
  if((VolumeDose_op&gt;0)&amp;(VolumeDose_op&lt;100))
  {
    dpSetWait(Adr, VolumeDose_op);
  }
  else
  {
  dpGetWait(Adr, VolumeDose_op);
  PercentPrisadki.text(VolumeDose_op);
}

